import { withRouter } from 'react-router-dom';

import './index.scss';

class PlaneSeats extends Component {
    render() {
        return(
            <div class="plane">
                <div class="cockpit">
                    <h1>Please select a seat</h1>
                </div>
                <div class="exit exit--front fuselage">
                    
                </div>
