                        <input type="checkbox" id="8A" />
                        <label for="8A">8A</label>
                        </div>
                        <div class="seat">
                        <input type="checkbox" id="9A" />
                        <label for="9A">9A</label>
                        </div>
                        <div class="seat">
                        <input type="checkbox" id="10A" />
                        <label for="10A">10A</label>
                        </div>
                    </div>
                    <div class="rowB">
                        <div class="seat">
                        <input type="checkbox" id="1B" />
                        <label for="1B">1B</label>
